import './App.css';
import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Chat from "./Components/Chat";

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
        name: "Garrett"
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Router>
            <div>


              <nav>
                <ul>
                  <li>
                    <Link to="/">Home</Link>
                  </li>
                  <li>
                    <Link to="/chat">chat</Link>
                  </li>
                </ul>
              </nav>

              {/* A <Switch> looks through its children <Route>s and
                  renders the first one that matches the current URL. */}
              <Switch>
                <Route path="/chat">
                  <Chat name={this.name}/>
                </Route>
                <Route path="/">
                  <Home />
                </Route>
              </Switch>
            </div>
          </Router>
          </header>
    </div>
    )
  }
}

function Home() {
  return <h2>Home</h2>;
}

export default App
